script: |
  super -f text -I q8094.spq | sort > q8094.out

inputs:
  - name: q8094.spq
    data: |
      SELECT DISTINCT 96 / col0 AS col2 FROM tab2 (FORMAT parquet) WHERE ( NULL ) NOT BETWEEN NULL AND - CAST ( + col2 AS REAL ) OR NOT NULL BETWEEN ( NULL ) AND - 9 + 10;
  - name: tab2

outputs:
  - name: q8094.out
    data: |
